____
‚ÄúThe spring of 1941 was a dark time for the Allied cause. In Africa Rommel laid siege to Tobruk and in the Balkans German forces invaded Greece after submitting Yugoslavia. To make things worse, in Iraq, Pro-German Prince Rashid Ali led a coup d‚ÄôeÃÅtat that, if successful, threatened to cut the British oil supply.
____
Despite the appeals of a few German diplomats and military, Hitler, with his eyes set on the forthcoming invasion of the Soviet Union, didn‚Äôt want to spare resources on what he thought to be a conflict of little strategic importance. As such, Germany‚Äôs aid to the Iraqi rebels resumed itself to a few military advisors and a small Luftwaffe‚Äôs force named ‚ÄòFliegerfuÃàhrer Irak‚Äô. 
____
‚ÄòFliegerfuÃàhrer Irak‚Äô consisted initially of one squadron of Bf 110s from the 4. Staffel/ZG 76 and a squadron of Heinkel 111 medium bombers, (12 aircraft each), plus a few Ju 52s and a Ju 90 transport aircraft. All aircrafts had their Luftwaffe codes and markings painted over and replaced by Iraqi national markings.
_____
The unit‚Äôs bulk arrived at its base in Mosul, northern Iraq, on May 13th and immediately started operation against the British. Despite some initial successes, the fact is that by the time FliegerfuÃàhrer Irak had arrived in Mosul the Iraqi rebels had already lost the initiative to the British and soon the unit started suffering losses accordingly. On May 29th, it left Iraq after having lost 14 Bf 110s and 5 He 111.
____
In this photo, Luftwaffe‚Äôs personnel gather around a Messerschmitt Bf 110 (already displaying Iraqi markings) at Tatoi Airfield, Athens, on May 14th, 1941, likely during a stop on the 36 hours-long ferry flight to Mosul via French Syria. The aircraft, with the nose painted with the distinctive ‚Äòshark mouth‚Äô unique to this unit, is one of the Bf 110 belonging to ZG 76.‚Äù
